import React from 'react';

const HomeSection = () => {
  const rectangleStyle = {
    position: 'absolute',
    top: '50px', // Adjust as needed
    left: '50px', // Adjust as needed
    width: '200px', // Adjust as needed
    height: '100px', // Adjust as needed
    backgroundColor: 'lightyellow', // Rectangle color
    opacity: 0.8, // Optional: Set the opacity for a semi-transparent effect
    padding: '15px', // Added padding to the text
    textAlign: 'center', // Center the text
    border: '2px solid lightyellow', // Added border to the rectangle
    borderRadius: '5px', // Optional: Add border-radius for rounded corners
  };

  const textStyle = {
    margin: 0,
    fontSize: '16px', // Adjust text size
    fontWeight: 'bold',
    color: 'blue', // Optional: Change text color
  };

  const descriptionStyle = {
    margin: 0,
    fontSize: '14px', // Adjust text size
    color: 'green', // Optional: Change text color
  };

  return (
    <div style={{ position: 'relative' }}>
      <img
        src="/scandinavian-interior-mockup-wall-decal-background 1.png"
        alt="Description of the image"
        style={{ maxWidth: '100%', maxHeight: '100%', height: 'auto', width: 'auto' }}
      />
      <div style={rectangleStyle}>
        <p style={textStyle}>New Arrival</p>
        <p style={descriptionStyle}>Discover Our New Collection</p>
      </div>
    </div>
  );
};

export default HomeSection;
